import React from 'react';

const AboutMe = () => {
    return (
        <div className='about-me-page'>
            <h2 className='heading'>Who am I?</h2>
            <h3>I am a 'junior'<a href='https://dictionary.cambridge.org/dictionary/english/polymath' rel='noopener noreferrer' target='_blank'>polymath</a>.</h3>
            <h3>I say junior as I am still mastering some of my fields of focus.</h3>
            <h3>I am a Physiologist. I am a Web Developer. I am a Teacher. I am a sports & exercise fanatic.</h3>
            <h3>My personality assessment suggests that I am heavily concerned with 'people mastery'.</h3>
            <h3>I love everything about the natural world.</h3>
            <h3>I am fascinated by everything about the 'unnatural' human world.</h3>
            <h3>I place utmost value in emotional bonds</h3>
        </div>
    )
}

export default AboutMe;
